function printpdf(n){console.log(n);var e=n.triggeringElement.id;const o=[$(n.affectedElements)];$.each(o,function(n,o){var t=o[0].id;console.log(t),$("#"+e).submit();var i=document.getElementById(t).innerHTML,d=document.body.innerHTML;document.body.innerHTML=i,window.print(),document.body.innerHTML=d})}